INSERT INTO `blog` (`id`, `author`, `title`, `content`, `date`, `image`) VALUES
(17, '<b>Part 1</b><br>\r\nSpaceX’s first goal in this historic project will be to send two uncrewed cargo spaceships to Mars which would aim at….the first manned mission to Mars…', 'Road to the Red Planet', '<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(239, 239, 239); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">A while back, SpaceX set a new milestone by becoming the first private company in the history of space exploration to send humans into space. However, this milestone is only one amongst the many that it aims to overcome on its road to revolutionise the space exploration industry. As it turns out, this remarkable company has many projects up its sleeve spanning across the entire decade and beyond. Amongst all these missions, one of the most important and talked about is the Mars Mission. Since 2017 SpaceX has been working towards achieving this aspirational mission of landing the first humans on the surface of Mars by 2024 and thereby laying the foundation stones for the eventual colonisation of our red neighbour.</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\r\n<img src=\"data:image/png;base64,\"><span style=\"color: rgb(239, 239, 239);\"><span style=\"font-size: 12pt; font-family: Arial; background-color: transparent; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none;\">Source</span><a href=\"https://www.google.com/imghp?hl=EN\" style=\"text-decoration:none;\"><span style=\"font-size: 12pt; font-family: Arial; background-color: transparent; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">:google images</span></a></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"color: rgb(239, 239, 239);\"><span style=\"font-size: 12pt; font-family: Arial; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The mission infrastructure for this ginormous project is quite expectedly, pervasive. The mission architecture includes fully reusable launch vehicles like the Starship,on-orbit propellant tanks, rapid turnaround landing/launching mounts and local production of rocket fuel on the Martian surface via in-situ resource utilisation.</span></span></p>\r\n<p><span style=\"color: rgb(239, 239, 239);\"><br></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"color: rgb(239, 239, 239);\"><span style=\"font-size: 12pt; font-family: Arial; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">SpaceX&rsquo;s first goal in this historic project will be to send two uncrewed cargo spaceships to Mars which would aim at confirming water resources, identifying hazards and setting up infrastructure for a life support system for future missions. Given the success of this launch, we will see the first manned mission to Mars, which will involve two crew and two cargo starships landing on the surface of Mars. Amongst others, the main objective of this mission will be to set up the infrastructure for the Mars base alpha. The first five starships are planned to stay on the Martian surface, though with the capability of returning to Earth on one of them will be available. The initial crew of this mission will have to reside on Mars for about 26 months, thus making self-sustainability very important. This will be achieved with the help of in-situ resource utilisation (ISRU) on the Mars surface.</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"color: rgb(239, 239, 239);\"><span style=\"font-size: 12pt; font-family: Arial; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">If all goes well, this program will lay the foundation for a colony on Mars which is the ultimate aim of this mission, thus making our dream of living on a planet other than ours a reality.</span></span></p>\r\n<p><span style=\"color: rgb(239, 239, 239);\"><br></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(239, 239, 239); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The Road to the Red Planet, however, is not going to be easy for SpaceX or Humanity in general. In the course of the next few articles, we will attempt to take a closer look at our red neighbour and try to highlight some of the key features of this program while also underlining some of the obstacles which might come in our way while reaching there.</span></p>', '2020-11-30', 'unnamed.png');

